#include <iostream>
#include <algorithm>
#include <cmath>
#include <string>
#include <vector>
#include <queue>
typedef unsigned long long ULL;

 int main (){

	 std::string str;

	 std::cin >> str;

	 int w = 0;
	 int b = 0;

	 for (int i = 0; i < str.size(); ++i) {
		 if (str[i] == 'W') {
			 w += 1;
		 }
		 if (str[i] == 'B') {
			 b += 1;
		 }
	 }

	 if (w > b) {
		 std::cout << "White wins" << std::endl;
	 }
	 else if (b > w) {
		 std::cout << "Black wins" << std::endl;
	 }
	 else {
		 std::cout << "Draw" << std::endl;
	 }
	 return 0;
}
